define([], function() { return "/* tslint:disable:no-unused-variable */\nimport * as React from 'react';\n/* tslint:enable:no-unused-variable */\n\nimport {\n  Toggle\n} from '../../../../index';\n\nexport const ToggleBasicExample = () => (\n  <div>\n    <Toggle\n      defaultChecked={ true }\n      label='Enabled and checked'\n      onText='On'\n      offText='Off' />\n    <Toggle\n      defaultChecked={ false }\n      label='Enabled and unchecked'\n      onText='On'\n      offText='Off' />\n    <Toggle\n      defaultChecked={ true }\n      disabled={ true }\n      label='Disabled and checked'\n      onText='On'\n      offText='Off' />\n    <Toggle\n      defaultChecked={ false }\n      disabled={ true }\n      label='Disabled and unchecked'\n      onText='On'\n      offText='Off' />\n  </div>\n);\n"; });